INSERT INTO `sections` (`section_id`, `section_name`, `section_content_html`, `section_show_in_menu`) VALUES
(1, 'Home', '<div id=\"carouselExampleIndicators\" class=\"carousel slide\" data-ride=\"carousel\">\n  <div class=\"carousel-inner\">\n    <div class=\"carousel-item active\">\n      <img class=\"d-block w-100\" src=\"img/portada/portada4.jpg\" alt=\"Primer slide\">\n    </div>\n    <div class=\"carousel-item\">\n      <img class=\"d-block w-100\" src=\"img/portada/portada3.jpg\" alt=\"Segundo slide\">\n    </div>\n    <div class=\"carousel-item\">\n      <img class=\"d-block w-100\" src=\"img/portada/portada2.jpg\" alt=\"Tercer slide\">\n    </div>\n    <div class=\"carousel-item\">\n      <img class=\"d-block w-100\" src=\"img/portada/portada1.jpg\" alt=\"Cuarto slide\">\n    </div>\n  </div>\n  <a class=\"carousel-control-prev\" href=\"#carouselExampleIndicators\" role=\"button\" data-slide=\"prev\">\n    <span class=\"carousel-control-prev-icon\" aria-hidden=\"true\"></span>\n    <span class=\"sr-only\">Previous</span>\n  </a>\n  <a class=\"carousel-control-next\" href=\"#carouselExampleIndicators\" role=\"button\" data-slide=\"next\">\n    <span class=\"carousel-control-next-icon\" aria-hidden=\"true\"></span>\n    <span class=\"sr-only\">Next</span>\n  </a>\n</div>\n', 1),
(2, 'Filà', '<br><br>\n<div class=\"container\">\n  <div class=\"text-center\">\n    <h3><strong>Bienvenidos a la Filà Mora Alcassabars</strong></h3>\n  </div>\n  <hr>\n<div class=\"container\">\n    <div class=\"row justify-content-center\">\n        <div class=\"col-10\">\n            <p class=\"mb-4\">¡Saludos y bienvenidos! Somos la Filà Mora Alcassabars, una comunidad de amigos que celebra la rica tradición y cultura mora en el corazón de Alaquàs. Desde nuestra fundación, nos hemos dedicado a preservar y compartir las emocionantes historias y la esencia de la cultura mora a través de nuestras festividades y eventos.</p>\n            <p class=\"mb-4\">Nuestra comparsa es más que un grupo festivo; somos una familia unida por la pasión por la música, el colorido de nuestras vestimentas y el orgullo de nuestras raíces. Cada año, participamos en las festividades locales, llevando alegría y energía a las calles con nuestros desfiles y fiestas llenas de tradició;n.</p>\n            <p class=\"mb-4\">En la Comparsa Mora Alcassabars, celebramos la diversidad y la herencia cultural que enriquece nuestra comunidad. Nos esforzamos por ser embajadores de la historia mora en Alaquàs, promoviendo el entendimiento intercultural y compartiendo con todos el espíritu festivo que nos une.</p>\n            <p class=\"mb-4\">Explora nuestra página para conocer más sobre nuestra historia, nuestras actividades y cómo puedes unirte a nosotros en esta apasionante aventura. ¡Únete a la Filà Mora Alcassabars y sé parte de una tradición viva que trasciende el tiempo!</p>\n            <p class=\"text-center\"><strong>¡Te esperamos con los brazos abiertos!</strong></p>\n        </div>\n    </div>\n</div>\n</div>\n<br>', 1),
(12, 'Galería', '<br>\n<div class=\"container\">\n  <div class=\"text-center\">\n    <h3><strong>Galería de fotos</strong></h3>\n  </div>\n  <hr>\n<div class=\"row\">\n  <div class=\"col-lg-4 col-md-12 mb-4 mb-lg-0\">\n    <img\n      src=\"img/galeria/galeria2.jpg\"\n      class=\"w-100 shadow-1-strong rounded mb-4\"\n      alt=\"Imagen 1\"\n    />\n\n    <img\n      src=\"img/galeria/galeria1.jpg\"\n      class=\"w-100 shadow-1-strong rounded mb-4\"\n      alt=\"Imagen 2\"\n    />\n  </div>\n\n  <div class=\"col-lg-4 mb-4 mb-lg-0\">\n    <img\n      src=\"img/galeria/galeria3.jpg\"\n      class=\"w-100 shadow-1-strong rounded mb-4\"\n      alt=\"Imagen 3\"\n    />\n\n    <img\n      src=\"img/galeria/galeria4.jpg\"\n      class=\"w-100 shadow-1-strong rounded mb-4\"\n      alt=\"Imagen 4\"\n    />\n  </div>\n\n  <div class=\"col-lg-4 mb-4 mb-lg-0\">\n    <img\n      src=\"img/galeria/galeria6.jpg\"\n      class=\"w-100 shadow-1-strong rounded mb-4\"\n      alt=\"WImagen 5\"\n    />\n\n    <img\n      src=\"img/galeria/galeria5.jpg\"\n      class=\"w-100 shadow-1-strong rounded mb-4\"\n      alt=\"Imagen 6\"\n    />\n  </div>\n</div>\n</div>\n<br>', 1),
(13, 'Eventos', '<br>\n<div class=\"container\">\n  <div class=\"text-center\">\n    <h3><strong>Próximos eventos</strong></h3>\n  </div>\n  <hr>\n <div class=\"text-center\">\n    <h5>No existen eventos públicos</strong></h5>\n  </div>\n</div>', 1);

