(1, 'Aviso legal', '<br>\n<div class=\"container\">\n  <div class=\"text-center\">\n    <h3><strong>Aviso Legal</strong></h3>\n  </div>\n  <hr>\n  <div>\n    <h4><strong>1. Datos Identificativos</strong></h4>\n    <p>En cumplimiento con el deber de información recogido en artículo 10 de la Ley 34/2002, de 11 de julio, de Servicios de la Sociedad de la Información y de Comercio Electrónico, a continuación se reflejan los siguientes datos: La empresa titular de este sitio web (en adelante, el Site) es Pablo Martínez Martínez, con domicilio en calle Montellano 10,5 (Xirivella).</p>\n  </div>\n  \n  <div>\n    <h4><strong>2. Usuarios</strong></h4>\n    <p>El acceso y/o uso de los portales de el Site atribuye la condición de USUARIO, que acepta, desde dicho acceso y/o uso, las Condiciones Generales de Uso aquí reflejadas. Las citadas Condiciones serán de aplicación independientemente de las Condiciones Generales de Contratación que en su caso resulten de obligado cumplimiento.</p>\n  </div>\n  \n  <div>\n    <h4><strong>3. Propiedad intelectual e industrial</strong></h4>\n    <p>Pablo Martínez Martínez por sí o como cesionario, es propietario de todos los derechos de propiedad intelectual e industrial de sus páginas webs, así como de los elementos contenidos en ellas (a título enunciativo, imágenes, sonido, audio, vídeo, software o textos; marcas o logotipos, combinaciones de colores, estructura y diseño, selección de materiales usados, programas de ordenador necesarios para su funcionamiento, acceso y uso, etc.), titularidad de Pablo Martínez Martínez o bien de sus licenciantes. Todos los derechos reservados. En virtud de lo dispuesto en los artículos 8 y 32.1, párrafo segundo, de la Ley de Propiedad Intelectual, quedan expresamente prohibidas la reproducción, la distribución y la comunicación pública, incluida su modalidad de puesta a disposición, de la totalidad o parte de los contenidos de esta página web, con fines comerciales, en cualquier soporte y por cualquier m