(2, 'Política de cookies', '<br>\n<div class=\"container\">\n  <div class=\"text-center\">\n    <h3><strong>Política de Cookies</strong></h3>\n  </div>\n  <hr>\n  <div>\n<p><strong>¿Qué son las cookies?</strong></p>\n<p>Las cookies son pequeños archivos de texto que se almacenan en tu dispositivo cuando visitas un sitio web. Estas cookies nos permiten reconocerte y recordar tus preferencias cuando regresas a nuestro sitio web. Las cookies también nos ayudan a analizar cómo se utiliza nuestro sitio web y a mejorar su rendimiento y funcionalidad.</p>\n<p><br></p>\n<p><strong>¿Qué tipos de cookies utilizamos?</strong></p>\n<ul>\n    <li>Cookies esenciales: Estas cookies son necesarias para el funcionamiento básico de nuestro sitio web. Nos permiten autenticar usuarios, mantener la seguridad del sitio y recordar tus preferencias de cookies.</li>\n    <li>Cookies de rendimiento: Estas cookies nos permiten recopilar información sobre cómo se utiliza nuestro sitio web, como las páginas que visitas y los enlaces en los que haces clic. Utilizamos esta información para mejorar el rendimiento y la experiencia del usuario en nuestro sitio web.</li>\n    <li>Cookies de funcionalidad: Estas cookies nos permiten recordar tus preferencias, como el idioma o la región, y proporcionarte funciones mejoradas y personalizadas. También pueden ser utilizadas para proporcionar servicios que has solicitado, como ver un video o comentar en un blog.</li>\n</ul>\n<p><br></p>\n<p><strong>¿Cómo puedes controlar las cookies?</strong></p>\n<p>Puedes controlar y administrar las cookies en tu navegador web. La mayoría de los navegadores te permiten rechazar o aceptar cookies, así como eliminar las cookies existentes. Ten en cuenta que si desactivas las cookies, es posible que algunas funciones de nuestro sitio web no estén disponibles o no funcionen correctamente.</p>\n<p><br></p>\n<p><strong>Cambios en nuestra Política de Cookies</strong></p>\n<p>Podemos actualizar esta Política de Cookies de vez en cuando para reflejar cambios en nuestras prácticas de cookies. Te recomendamos que revises esta página periódicamente para estar al tanto de cualquier cambio. La fecha de la última actualización se indica al final de esta Política de Cookies.</p>\n<p><br></p>\n<p><strong>Contacto</strong></p>\n<p>Si tienes alguna pregunta sobre nuestra Política de Cookies, no dudes en ponerte en contacto con nosotros mediante el siguiente correo electrónico: pablo.mrtz@gmail.com.</p>\n<p><br></p>\n<p><strong>Última actualización:</strong> 17 de mayo de 2024</p>\n  \n</div>\n</div>', 1),
(3, 'Política de privacidad', '<br>\r\n<div class=\"container\">\r\n  <div class=\"text-center\">\r\n    <h3><strong>Política de Privacidad</strong></h3>\r\n  </div>\r\n  <hr>\r\n  <div>\r\n    <p>Pablo Martínez Martínez se compromete a proteger y respetar tu privacidad. Esta política de privacidad describe cómo recopilamos, utilizamos y protegemos la información personal que nos proporcionas a través de nuestro sitio web <a href=\"http://www.alcassabars.com\">http://www.alcassabars.com</a>.</p>\r\n  </div>\r\n  \r\n  <div>\r\n    <h4><strong>Información que Recopilamos</strong></h4>\r\n    <ul>\r\n      <li>Información que nos proporcionas al completar formularios en nuestro sitio web, como el formulario de contacto. Esto puede incluir tu nombre, dirección de correo electrónico, número de teléfono y mensaje.</li>\r\n      <li>Datos técnicos, como la dirección IP utilizada para conectarte a Internet, tu ubicación, tipo de navegador, versión del navegador, sistema operativo y plataforma.</li>\r\n      <li>Información sobre tu visita a nuestro sitio web, incluidos los productos que has visto o buscado.</li>\r\n    </ul>\r\n  </div>\r\n  \r\n  <div>\r\n    <h4><strong>Uso de la Información</strong></h4>\r\n    <ul>\r\n      <li>Responder a tus consultas y proporcionarte la información que nos solicitas.</li>\r\n      <li>Mejorar y personalizar tu experiencia en nuestro sitio web.</li>\r\n      <li>Enviarte comunicaciones relacionadas con eventos, actividades o noticias de la Comparsa que puedan ser de tu interés.</li>\r\n      <li>Analizar tendencias de uso y mejorar la funcionalidad y seguridad de nuestro sitio web.</li>\r\n    </ul>\r\n  </div>\r\n  \r\n  <div>\r\n    <h4><strong>Almacenamiento y Seguridad de los Datos</strong></h4>\r\n    <p>Tus datos personales se almacenarán de forma segura y solo serán accesibles para aquellos que necesiten utilizarlos para los fines descritos anteriormente. Tomamos medidas razonables para proteger tus datos contra acceso no autorizado, pérdida, uso indebido o alteración.</p>\r\n  </div>\r\n  \r\n  <div>\r\n    <h4><strong>Divulgación de Información</strong></h4>\r\n    <p>No compartiremos tu información personal con terceros sin tu consentimiento, excepto cuando sea necesario para cumplir con obligaciones legales, proteger nuestros derechos o en casos específicos permitidos por la ley.</p>\r\n  </div>\r\n  \r\n  <div>\r\n    <h4><strong>Tus Derechos</strong></h4>\r\n    <p>Tienes derecho a acceder, corregir, actualizar o solicitar la eliminación de tu información personal en cualquier momento. También puedes oponerte al procesamiento de tus datos personales, solicitar la restricción del procesamiento o la portabilidad de tus datos. Para ejercer estos derechos, contáctanos utilizando la información de contacto proporcionada a continuación.</p>\r\n  </div>\r\n  \r\n  <div>\r\n    <h4><strong>Cambios en esta Política de Privacidad</strong></h4>\r\n    <p>Podemos actualizar esta política de privacidad ocasionalmente para reflejar cambios en nuestras prácticas de recopilación y uso de información. Te recomendamos revisar esta página periódicamente para mantenerse informado sobre cómo protegemos tu privacidad.</p>\r\n  </div>\r\n  \r\n  <div>\r\n    <h4><strong>Contacto</strong></h4>\r\n    <p>Si tienes preguntas sobre nuestra política de privacidad o sobre cómo manejamos tus datos personales, contáctanos en <a href=\"mailto:pablo.mrtz@gmail.com\">pablo.mrtz@gmail.com</a> o <a href=\"tel:+34676297601\">+34 676297601</a>.</p>\r\n  </div>\r\n</div>', 1),
(4, 'Contacto', '<br>\r\n<div class=\"container\">\r\n    <div class=\"row justify-content-center\">\r\n        <div class=\"col-10\">\r\n            <p class=\"text-center\"><strong>Contacto</strong></p>\r\n<br>\r\n            <form action=\"enviar_email.php\" method=\"post\">\r\n                <div class=\"form-group\">\r\n                    <label for=\"nombre\">Nombre:</label>\r\n                    <input type=\"text\" class=\"form-control\" id=\"nombre\" name=\"nombre\" required>\r\n                </div>\r\n                <div class=\"form-group\">\r\n                    <label for=\"email\">Correo Electrónico:</label>\r\n                    <input type=\"email\" class=\"form-control\" id=\"email\" name=\"email\" required>\r\n                </div>\r\n                <div class=\"form-group\">\r\n                    <label for=\"asunto\">Asunto:</label>\r\n                    <input type=\"text\" class=\"form-control\" id=\"asunto\" name=\"asunto\" required>\r\n                </div>\r\n                <div class=\"form-group\">\r\n                    <label for=\"mensaje\">Mensaje:</label>\r\n                    <textarea class=\"form-control\" id=\"mensaje\" name=\"mensaje\" rows=\"4\" required></textarea>\r\n                </div>\r\n<br>\r\n                <button type=\"submit\" class=\"btn btn-primary\">Enviar Mensaje</button>\r\n            </form>\r\n        </div>\r\n    </div>\r\n</div>\r\n<br>\r\n\r\n<script>\r\ndocument.querySelector(\'form\').addEventListener(\'submit\', function(event) {\r\n        event.preventDefault();\r\n\r\n        const formData = new FormData(this);\r\n\r\n        fetch(\'enviar_email.php\', {\r\n            method: \'POST\',\r\n            body: formData\r\n        })\r\n        .then(response => response.json())\r\n        .then(data => {\r\n            if (data.status === \'success\') {\r\n                alert(data.message);\r\n            } else {\r\n                alert(data.message);\r\n            }\r\n        })\r\n        .catch(error => {\r\n            console.error(\'Error al enviar el formulario:\', error);\r\n        });\r\n    });\r\n</script>', 1);

